webpackJsonp([0xacbd500322622800],{"./node_modules/json-loader/index.js!./.cache/json/eslint-config.json":function(n,s){n.exports={data:{site:{siteMetadata:{title:"Note Site",author:"stone"}},markdownRemark:{id:"/home/peng/develop/workspace/stone-site/src/pages/2017-12-25-eslint-config/index.md absPath of file >>> MarkdownRemark",html:'<ul>\n<li>格式化 JS 代码,统一代码风格</li>\n<li>分析 JS 代码,提前发现问题,提高代码质量</li>\n</ul>\n<h2 id="安装-eslint"><a href="#%E5%AE%89%E8%A3%85-eslint" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>安装 ESLint</h2>\n<div class="gatsby-highlight">\n      <pre class="language-bash"><code><span class="token comment" spellcheck="true"># 安装依赖,需要node版本大于4.0,npm版本大于2.0</span>\n<span class="token function">npm</span> <span class="token function">install</span> eslint --save-dev\n\n<span class="token comment" spellcheck="true"># 初始化配置文件</span>\n./node_modules/.bin/eslint --init\n\n<span class="token comment" spellcheck="true"># 分析JS代码</span>\n./node_modules/.bin/eslint yourfile.js\n</code></pre>\n      </div>\n<h2 id="配置-eslint"><a href="#%E9%85%8D%E7%BD%AE-eslint" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>配置 ESLint</h2>\n<ul>\n<li>ESLint 使用支持多种格式的配置文件,可是以 JavaScript,JSON 或 YAML</li>\n<li>配置的内容可以写在<code>.eslintrc.*</code>文件,也可以写在<code>package.json</code>文件内的<code>eslintConfig</code>域下面</li>\n<li>配置文件一般放在工程的根目录,若无法找到将使用<code>~/</code>下的</li>\n<li>可以通过命令行指定配置文件<code>eslint -c myconfig.json myfiletotest.js</code></li>\n<li>配置文件的应用范围是根目录下的所有文件和文件夹,若子文件夹中有其他的配置文件,会优先使用子文件夹中的</li>\n<li>\n<p>配置信息大致分为以下几种:</p>\n<ol>\n<li>Environments: 运行环境的信息,每个环境将会自带一些默认的全局变量信息</li>\n<li>Globals: 全局变量,运行时可以访问到的变量</li>\n<li>Rules: 规则,定义每种规则的报错等级</li>\n</ol>\n</li>\n</ul>\n<h3 id="指定解析器选项parser-options"><a href="#%E6%8C%87%E5%AE%9A%E8%A7%A3%E6%9E%90%E5%99%A8%E9%80%89%E9%A1%B9parser-options" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>指定解析器选项(Parser Options)</h3>\n<ul>\n<li>Parser Options 用于指定 JavaScript 的版本,默认的指定版本是 ECMAScript5,通过修改解析器选项可以指定为其他版本</li>\n<li>支持 JSX 不等同于支持 React,后者有自己的特殊语法,若要支持 React 可使用插件<a href="https://github.com/yannickcr/eslint-plugin-react">eslint-plugin-react</a></li>\n<li>支持 ES6 的语法不代表支持新的 ES6 的全局变量(例如新的类型<code>Set</code>).<br>\n若要支持 ES6 的语法:<code>{ "parserOptions": { "ecmaVersion": 6 } }</code>;\n若要支持 ES6 的全局变量: <code>{ "env": { "es6": true } }</code>,使用这个会自动支持 ES6 的语法</li>\n<li>\n<p>详细配置如下:</p>\n<ul>\n<li>ecmaVersion - 指定支持哪个版本的 JavaScript 语法,值为 3,5(默认),6,7,8,或者 2015(6),2016(7)..</li>\n<li>sourceType - 是否使用模块,<code>script</code>(默认)或者 <code>module</code></li>\n<li>ecmaFeatures - 使用哪些附加的功能</li>\n<li>globalReturn 是否支持在全局域中使用 return</li>\n<li>impliedStrict 是否支持严格模式(当 ecmaVersion>=5 时生效)</li>\n<li>jsx 是否支持 JSX</li>\n<li>experimentalObjectRestSpread 是否支持<a href="https://github.com/yannickcr/eslint-plugin-react">rest/spread</a>语法</li>\n</ul>\n</li>\n</ul>\n<p>例子</p>\n<div class="gatsby-highlight">\n      <pre class="language-json"><code><span class="token punctuation">{</span>\n  <span class="token property">"parserOptions"</span><span class="token operator">:</span> <span class="token punctuation">{</span>\n    <span class="token property">"ecmaVersion"</span><span class="token operator">:</span> <span class="token number">6</span><span class="token punctuation">,</span>\n    <span class="token property">"sourceType"</span><span class="token operator">:</span> <span class="token string">"module"</span><span class="token punctuation">,</span>\n    <span class="token property">"ecmaFeatures"</span><span class="token operator">:</span> <span class="token punctuation">{</span>\n      <span class="token property">"jsx"</span><span class="token operator">:</span> <span class="token boolean">true</span>\n    <span class="token punctuation">}</span>\n  <span class="token punctuation">}</span><span class="token punctuation">,</span>\n  <span class="token property">"rules"</span><span class="token operator">:</span> <span class="token punctuation">{</span>\n    <span class="token property">"semi"</span><span class="token operator">:</span> <span class="token number">2</span>\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span>\n</code></pre>\n      </div>\n<h3 id="指定解析器parser"><a href="#%E6%8C%87%E5%AE%9A%E8%A7%A3%E6%9E%90%E5%99%A8parser" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>指定解析器(Parser)</h3>\n<p>ESLint 支持一下几种解析器</p>\n<ul>\n<li><a href="https://github.com/eslint/espree">Espree</a> 默认使用</li>\n<li><a href="https://www.npmjs.com/package/esprima">Esprima</a></li>\n<li><a href="https://www.npmjs.com/package/babel-eslint">babel-eslint</a> 包装了<a href="http://babeljs.io/">Babel</a>以适应 ESLint</li>\n</ul>\n<h3 id="指定环境environments"><a href="#%E6%8C%87%E5%AE%9A%E7%8E%AF%E5%A2%83environments" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>指定环境(Environments)</h3>\n<p>运行环境的信息,每个环境将会自带一些默认的全局变量信息,支持配置以下环境:</p>\n<ul>\n<li>browser - 浏览器环境变量</li>\n<li>node - Node.js 的全局变量</li>\n<li>commonjs - CommonJS global variables and CommonJS scoping (use this for browser-only code that uses Browserify/WebPack).</li>\n<li>shared-node-browser - Node.js 和 Browser 同时拥有的变量</li>\n<li>es6 - ECMAScript6 的变量,除了 modules</li>\n<li>jest - Jest global variables.</li>\n<li>jquery - jQuery 的全局变量</li>\n<li>prototypejs - Prototype.js 的全局变量</li>\n<li>shelljs - ShellJS 的全局变量</li>\n<li>mongo - MongoDB 的全局变量</li>\n</ul>\n<p>以上环境不是互斥的,可以一次指定多个.环境信息不仅可以在配置文件中指定,也可以在代码文件中指定</p>\n<div class="gatsby-highlight">\n      <pre class="language-javascript"><code><span class="token comment" spellcheck="true">/* eslint-env node, mocha */</span>\n<span class="token comment" spellcheck="true">// 上面的注释表示此文件支持Node.js和Mocha两个环境</span>\n</code></pre>\n      </div>\n<p>环境信息的配置示例</p>\n<div class="gatsby-highlight">\n      <pre class="language-json"><code><span class="token punctuation">{</span>\n  <span class="token property">"env"</span><span class="token operator">:</span> <span class="token punctuation">{</span>\n    <span class="token property">"browser"</span><span class="token operator">:</span> <span class="token boolean">true</span><span class="token punctuation">,</span>\n    <span class="token property">"node"</span><span class="token operator">:</span> <span class="token boolean">true</span>\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span>\n</code></pre>\n      </div>\n<h3 id="指定全局变量"><a href="#%E6%8C%87%E5%AE%9A%E5%85%A8%E5%B1%80%E5%8F%98%E9%87%8F" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>指定全局变量</h3>\n<p>检查规则<code>Undeclared Variables(no-undef)</code>会警告使用未声明的变量,指定全局变量可以使得它们通过这个检查,\n全局变量也可以在文件头中指定</p>\n<div class="gatsby-highlight">\n      <pre class="language-javascript"><code><span class="token comment" spellcheck="true">/* global var1, var2 */</span>\n</code></pre>\n      </div>\n<div class="gatsby-highlight">\n      <pre class="language-javascript"><code><span class="token comment" spellcheck="true">/* global var1:false, var2:false */</span>\n</code></pre>\n      </div>\n<p>使用<code>true</code>或<code>false</code>表示是否支持这个全局变量,配置示例:</p>\n<div class="gatsby-highlight">\n      <pre class="language-json"><code><span class="token punctuation">{</span>\n  <span class="token property">"globals"</span><span class="token operator">:</span> <span class="token punctuation">{</span>\n    <span class="token property">"var1"</span><span class="token operator">:</span> <span class="token boolean">true</span><span class="token punctuation">,</span>\n    <span class="token property">"var2"</span><span class="token operator">:</span> <span class="token boolean">false</span>\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span>\n</code></pre>\n      </div>\n<h3 id="配置-eslint-插件plugins"><a href="#%E9%85%8D%E7%BD%AE-eslint-%E6%8F%92%E4%BB%B6plugins" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>配置 ESLint 插件(Plugins)</h3>\n<p>ESLint 支持使用第三方插件,前提是其已经使用 npm 安装在本地.\n通过字段<code>plugins</code>可以声明所有的插件,插件名字中的<code>eslint-plugin-</code>可以省略.\n配置示例:</p>\n<div class="gatsby-highlight">\n      <pre class="language-json"><code><span class="token punctuation">{</span>\n  <span class="token property">"plugins"</span><span class="token operator">:</span> <span class="token punctuation">[</span><span class="token string">"plugin1"</span><span class="token punctuation">,</span> <span class="token string">"eslint-plugin-plugin2"</span><span class="token punctuation">]</span>\n<span class="token punctuation">}</span>\n</code></pre>\n      </div>\n<h3 id="配置规则rule"><a href="#%E9%85%8D%E7%BD%AE%E8%A7%84%E5%88%99rule" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>配置规则(Rule)</h3>\n<p>ESLint 支持许多的检查规则,每种规则都有三种报错等级:</p>\n<ul>\n<li><code>off</code>或<code>0</code> - 不使用此规则</li>\n<li><code>warn</code>或<code>1</code> - 警告</li>\n<li><code>error</code>或<code>2</code> - 报错(返回错误码<code>1</code>)</li>\n</ul>\n<p>若一个规则有一个额外的配置选项,则可以使用一个数组来配置它,\n配置示例:</p>\n<div class="gatsby-highlight">\n      <pre class="language-json"><code><span class="token punctuation">{</span>\n  <span class="token property">"rules"</span><span class="token operator">:</span> <span class="token punctuation">{</span>\n    <span class="token property">"eqeqeq"</span><span class="token operator">:</span> <span class="token string">"off"</span><span class="token punctuation">,</span>\n    <span class="token property">"curly"</span><span class="token operator">:</span> <span class="token string">"error"</span><span class="token punctuation">,</span>\n    <span class="token property">"quotes"</span><span class="token operator">:</span> <span class="token punctuation">[</span><span class="token string">"error"</span><span class="token punctuation">,</span> <span class="token string">"double"</span><span class="token punctuation">]</span>\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span>\n</code></pre>\n      </div>\n<h3 id="扩展extend配置文件"><a href="#%E6%89%A9%E5%B1%95extend%E9%85%8D%E7%BD%AE%E6%96%87%E4%BB%B6" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>扩展(Extend)配置文件</h3>\n<p>一个配置文件能扩展自其他的基本配置文件,字段<code>extends</code>可以包含一个字符串或字符串数组.<br>\n<code>rules</code>字段可以更改或者覆盖基本配置文件中的规则</p>\n<ul>\n<li>\n<p>派生的 rule 配置会改变基本配置中的报错等级,但会继承其他可选配置</p>\n<ul>\n<li>基本配置 <code>"eqeqeq": ["error", "allow-null"]</code></li>\n<li>派生配置 <code>"eqeqeq": "warn"</code></li>\n<li>结果 <code>"eqeqeq": ["warn", "allow-null"]</code></li>\n</ul>\n</li>\n<li>\n<p>派生的 rule 配置可以覆盖可选配置</p>\n<ul>\n<li>基本配置 <code>"quotes": ["error", "single", "avoid-escape"]</code></li>\n<li>派生配置 <code>Derived config: "quotes": ["error", "single"]</code></li>\n<li>结果 <code>"quotes": ["error", "single"]</code></li>\n</ul>\n</li>\n</ul>\n<h3 id="忽略文件和目录"><a href="#%E5%BF%BD%E7%95%A5%E6%96%87%E4%BB%B6%E5%92%8C%E7%9B%AE%E5%BD%95" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>忽略文件和目录</h3>\n<h2 id="参考资料"><a href="#%E5%8F%82%E8%80%83%E8%B5%84%E6%96%99" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>参考资料</h2>\n<p><a href="https://eslint.org/">EsLint 官网</a></p>',tableOfContents:'<ul>\n<li><a href="#%E5%AE%89%E8%A3%85-eslint">安装 ESLint</a></li>\n<li>\n<p><a href="#%E9%85%8D%E7%BD%AE-eslint">配置 ESLint</a></p>\n<ul>\n<li><a href="#%E6%8C%87%E5%AE%9A%E8%A7%A3%E6%9E%90%E5%99%A8%E9%80%89%E9%A1%B9parser-options">指定解析器选项(Parser Options)</a></li>\n<li><a href="#%E6%8C%87%E5%AE%9A%E8%A7%A3%E6%9E%90%E5%99%A8parser">指定解析器(Parser)</a></li>\n<li><a href="#%E6%8C%87%E5%AE%9A%E7%8E%AF%E5%A2%83environments">指定环境(Environments)</a></li>\n<li><a href="#%E6%8C%87%E5%AE%9A%E5%85%A8%E5%B1%80%E5%8F%98%E9%87%8F">指定全局变量</a></li>\n<li><a href="#%E9%85%8D%E7%BD%AE-eslint-%E6%8F%92%E4%BB%B6plugins">配置 ESLint 插件(Plugins)</a></li>\n<li><a href="#%E9%85%8D%E7%BD%AE%E8%A7%84%E5%88%99rule">配置规则(Rule)</a></li>\n<li><a href="#%E6%89%A9%E5%B1%95extend%E9%85%8D%E7%BD%AE%E6%96%87%E4%BB%B6">扩展(Extend)配置文件</a></li>\n<li><a href="#%E5%BF%BD%E7%95%A5%E6%96%87%E4%BB%B6%E5%92%8C%E7%9B%AE%E5%BD%95">忽略文件和目录</a></li>\n</ul>\n</li>\n<li><a href="#%E5%8F%82%E8%80%83%E8%B5%84%E6%96%99">参考资料</a></li>\n</ul>',frontmatter:{title:"使用ESLint提高代码质量",date:"December 25, 2017",tags:["javascript","web"]}}},pathContext:{path:"/eslint-config"}}}});
